                <a href="#">Policy</a>
                <a href="#">Content</a>
            </header>
            <div id="main">
                <p id="local-time"/>
                {setInterval(tick, 1000)}
            </div>
            <footer id="footer">Footer</footer>
        </div>
    );
}

function tick() {
    ReactDOM.render(
      document.getElementById('local-time').value = Date.now()
